import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import Sobre from "../Pages/Sobre.jsx"

const Router = () => {

    return(
        <BrowserRouter>
        <Switch>
            <Route path="/" extact component={Sobre}/>

            
        </Switch>
        </BrowserRouter>

    )
}

export default Router
